INSERT INTO jdmail.mail_list values(5000, 'song','song@alipay.com','210.43.219.57','jack','jack@qq.com','182.89.31.175','来聊聊：科技公司应该留住35岁员工吗？','在IT互联网行业，年龄焦虑已是老生常谈，过了35岁非高管则劝退仿佛成了常规操作。但实际上，高龄程序员在不少硅谷IT公司是普遍现象，我们常用的手机、pc系统也是这群程序员们的成果。偏爱年轻员工是企业利益机制决定的，但一味标榜公司年轻化，会不会是一种发展误区和短视的做法呢？来，咱们聊聊科技公司「应该」留住年长员工的理由～','1599744709','0','0','0','备注', '汉语');
